import React, { Component, useState } from "react";
import { BrowserRouter, Switch, Route, Link } from "react-router-dom";
import Ingreso from "./logout/ingreso";
import Registro from "./logout/registro";

class Menu extends Component{
    constructor(props){
        super(props);
        this.state={
            bandera: true
        }
    }

    render(){
        return (
            <BrowserRouter>
                <nav>
                    <ul>
                        <Link to="/"><button onClick={()=>{this.setState({bandera: !this.state.bandera})}}>Registrar</button></Link>
                        <Link to="/Loggin"><button>Ingresar</button></Link>
                    </ul>
                </nav>
                <Switch>
                    <Route path="/"><Registro/></Route>
                    <Route path="/Loggin"><Ingreso/></Route>
                </Switch>
            </BrowserRouter>    
        )
    }
}


export default Menu;
